import React from "react";

import { Box, Container, Grid, List } from "@mui/material";
import { styled } from "@mui/material";
import Img from "../ asset/fod.jpeg";

const Logo = styled("img")(({ theme }) => ({
  position: "relative",
  width: "200px",
  display: "",
  alignItems: "center",
  justifyContent: "center",

  [theme.breakpoints.down("sm")]: {
    width: "100px",
    position: "relative",
    left: "",
    top: "50px",
    display: "flex",
  },
}));

function Home() {
  return (
    <>
      <Box
        sx={{
          height: "799px",
          maxWidth: "100%",
          backgroundColor: "#000000",
        }}
      >
        <Container>
          <Logo src={Img}></Logo>
        </Container>
      </Box>
    </>
  );
}

export default Home;
